import React, { Component } from 'react'

export default class Prices extends Component {
  state = {
    currency: 'USD'
  }
  render() {
    return (
      <div>
        Prices
        <ul className="list-group">
          <li className="list-group-item">
            BitCoint for {this.props.bpi.USD.description}
            : 
          </li>
        </ul>
      </div>
    )
  }
}
